import React, {Fragment} from 'react';
import styled from 'styled-components';

import FunctionItems from './FunctionItems';

const FunctionList = () => {
  return (
    <Fragment>
      <FunctionItemsWrapper>
        <FunctionItem>資産登録</FunctionItem>
        <FunctionItem>資産一覧</FunctionItem>
        <FunctionItem>PL分析</FunctionItem>
        <FunctionItem>BS分析</FunctionItem>
        <FunctionItem>税務分析</FunctionItem>
      </FunctionItemsWrapper>
    </Fragment>
  );
};

const FunctionItemsWrapper = styled.div`
`;

export default FunctionList;
